import React,{Component} from 'react'
import './App.css';
import stateVideo from './stateVideo'
import Nav from './component/Nav'

class App extends Component{

  state={
    video:stateVideo
  }


  render(){
    const allVideo=Object.keys(this.state.video)
              .map(key =><option value={key}/>)
    return (
      <Nav allTitleVideo={this.allVideo}></Nav>
    );
  }
}

export default App;
